import React from "react";

import CartItem from '../Cart/CartItem/CartItem';

import styles from "./Cart.module.css";

const Cart = (props) => {
  const cardItems = [
    {
      id: "b3",
      name: "Noodles",
      description: "A japanese specialty!",
      price: 12.5,
    },
    {
      id: "2f",
      name: "Vegetal Burger",
      description: "Healthy, vegan, saucy",
      price: 10.99,
    },
  ].map((item) => (
    <CartItem
      id={item.id}
      key={item.id}
      name={item.name}
      price={item.price}
    />
  ));

  return (
    <div>
      {cardItems}
      <div></div>
      <div></div>
    </div>
  );
};

export default Cart;
